            this.houseButtons[floorDescription].is_hover = true;
            this.floorDescriptions[floorDescription].is_hover = true;
            this.housePaths[floorDescription].is_hover = true;   

            this.houseButtons.forEach(item => {
                item.is_hover || item.is_open ? item.active = true : item.active = false;
                if (item.is_open) {
                    this.floorDescriptions[floorDescription].is_hover = false;
                    this.housePaths[floorDescription].is_hover = false;
                }
            });    
        },
        mouseleave(floorDescription) {
            this.floorDescriptions[floorDescription].is_hover = false;
            
            for (var i = 0; i < this.floors.length; i++) { 
                if (this.floors[i].is_open) {              
                    this.houseButtons[i].is_hover = false;   
                    this.houseButtons[i].is_open = true;   
                } else {               
                    this.houseButtons[i].is_hover = false;   
                }             
            }

            this.houseButtons.forEach(item => {
                item.is_hover || item.is_open ? item.active = true : item.active = false;
                if (item.is_open) {
                    this.floorDescriptions[floorDescription].is_hover = false;
                    this.housePaths[floorDescription].is_hover = false
                }
            });   

            this.housePaths[floorDescription].is_hover = false;        
        },
        openFloor(floor, floorDescription) {
            
            this.floors[floor].is_open = true;
            this.floorDescriptions[floor].is_hover = false;

            this.housePaths[floor].is_hover = false;        
            
            for (var i = 0; i < this.floorDescriptions.length; i++) {
                this.floorDescriptions[i].is_open = false;
            }
            for (var i = 0; i < this.houseButtons.length; i++) {
                this.houseButtons[i].is_open = false;
                this.houseButtons[floor].is_open = true;
            }
            for (var i = 0; i < this.floors.length; i++) {
                this.floors[i].is_open = false;
                this.floors[floor].is_open = true;
            }
            for (var i = 0; i < this.appartments.length; i++) {
                this.appartments[i].is_open = false;
            }   

            this.houseButtons.forEach(item => {
                item.is_hover || item.is_open ? item.active = true : item.active = false;
            }); 
        },                                       
        closeFloor(floor) {
            this.floors[floor].is_open = false;
            this.houseButtons[floor].is_open = false;
            this.houseButtons[floor].is_hover = false;

            this.houseButtons.forEach(item => {
                item.is_hover || item.is_open ? item.active = true : item.active = false;
            }); 
        },
        openAppartment(appartment, floor) {
            console.log('open');
            console.log(appartment);
            console.log(floor);
            this.appartments[appartment].is_open = true;
            this.floors[floor].is_open = false;            
        },
        closeAppartment(appartment, floor) {
            console.log('close');
            console.log(appartment);
            console.log(floor);
            this.appartments[appartment].is_open = false;
            this.floors[floor].is_open = true;
        }
    }
}
</script>